const App=()=>{
    return <>
            <h1>hello world</h1>
          </>
    
 
};



const Moive=(props)=>{
  const {title, author,imgURL}=props;
  return (
    <div className="eachmoive">
    <p>{title}</p>
    <p>{author}</p>
   
    <img className="imgtag"src={imgURL} alt="rgmlk"/>
  </div>
  );
  
}




export default App;
